import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  constructor(private router: Router) {}

  navigateToLogin(): void {
    this.router.navigate(['/login']);
  }

  navigateToRegister(): void {
    this.router.navigate(['/register']);
  }
}
<div class="container">
  <h1>Welcome to AMS</h1>
  <p>This is a basic Angular + .NET Core application.</p>
  
  <div class="buttons">
    <button class="btn btn-primary" (click)="navigateToLogin()">Login</button>
    <button class="btn btn-secondary" (click)="navigateToRegister()">Register</button>
  </div>
</div>
